Na sprzedaż osobisty Volvo V60 D5 2.0 163km

Summum: komfort, niezawodność i luksus w klasie premium!

Sprzedaję samochód, ponieważ planuję zakup nowego pojazdu o świeższym roczniku.

Główne cechy:

Model: Volvo V60 D5 Summum

Rok produkcji: 2013

Silnik: 5-cylindrowy, niezawodny, mocny i ekonomiczny

Skrzynia biegów: AISIN, automatyczna

Przebieg: Potwierdzony i oryginalny

Doskonały komfort i wysoka niezawodność

Dodatkowo, samochód posiada bardzo bogate wyposażenie, w tym:

Skórzana tapicerka;

Elektrycznie regulowany fotel kierowcy z pamięcią;

Nawigacja GPS z kolorowym ekranem;

Tempomat z ogranicznikiem prędkości;

Elektrycznie podgrzewane przednie fotele;

Automatyczna dwustrefowa klimatyzacja;

Czujniki deszczu oraz zmierzchu;

Dodatkowe złącza typu USB, AUX, Bluetooth;

Wielofunkcyjna kierownica obszyta skórą;

Bogaty system multimedialny;

Dynamiczne światła skrętne;

Czujniki parkowania przód, tył;

Virtual Cockpit - 3 tryby wyświetlacza do wyboru;

Funkcja Start&Stop jest wyprogramowana.

Seat Altea 1,6 102 KM, 2007 r. , benzyna + gaz (instalacja BRC). Przebieg 260937km.

Przegląd okresowy ważny do lutego 2026 r. 

Ubezpieczenie ważne do kwietnia 2026 r. Badanie szczelności zbiornika LPG ważne do 2031 r. 

Samochód kupiłem w maju 2015 r. i od tego czasu stale użytkuję. Samochód bardzo funkcjonalny,  tani w eksploatacji, mało awaryjny. Środek zadbany i czysty. Wewnątrz nie były palone papierosy. Na karoserii widoczne drobne ogniska korozji. Samochód zawiera otarcie prawych drzwi oraz nadkola prawego (jak na zdjęciach). Sprzedaż wynika z faktu zakupu przeze mnie nowego auta.

 Wyposażenie: 

1. ABS, ESP; 

2. Poduszka powietrzna kierowcy i pasażera;

3. Poduszki boczne;

4. Wspomaganie kierownicy;

5. Centralny zamek;

6. Tempomat;

7. Klimatyzacja manualna (sprawna);

8. Elektryczne szyby przód i tył;

9. Lusterka boczne ustawiane elektrycznie;

10. Alufelgi;

11. Isofix;

12. Radio fabryczne;

13.Dwa kluczyki

Sprzedam Citroen AX 1.0 KAT



- tylne boczne szyby uchylne;

- immobiliser;

- przebieg 40.436;

- przegląd techniczny do 24.11.2024 roku;

- OC do 24.08.2025 roku;

- data pierwszej rejestracji: 25.08.1998 rok



Samochód w dobtym stanie, dobrze się sprawuje, bez żadnych problemów.

Do rozsądnej negocjacji.



Numer do kontaktu: 51*******02 (pięć jeden dziewięć cztery dziewięć zero trzy zero dwa)



Zapraszam i pozdrawiam

Dzień dobrym, mam do sprzedania samochód osobowy marki Volkswagen Passat wyprodukowany w 2000 roku, który został wyposażony w silnik wysokoprężny turbodoładowany o pojemności 1896 cm3, legitymujący się mocą 115 KM, który pokonał do tej pory 360000 km. Samochód pod względem mechanicznym w średnim stanie, silnik odpala bez problemów ciepły czy zimny, lecz nie ma mocy, skrzynia biegów przez brak mocy silnika lekko szarpie, zawieszenie do przejrzenia. Wizualnie Passat prezentuje się jak na zdjęciach dodam, że pojazd jest używany i posiada normalne ślady wynikające z wieku i eksploatacji. Wnętrze pojazdu prezentuje się jak na  zdjęciach.

Passta jest wyposażenia w:

- Automatyczną klimatyzację;

- ABS z ESP;

- Centralny zamek;

- Elektryczne szyby przednie i tylne;

- Elektryczne lusterka;

- 4 x airbag;

I wiele innych rzeczy o których zapomniałem wspomnieć.

Zapraszam wszystkie zainteresowane osoby do kontaktu telefonicznego w celu uzyskania większej ilości informacji. Samochód do obejrzenia w Łodzi po wcześniejszym umówieniu się.

OC ważne do 06.06.2025 roku.

Przegląd techniczny BRAK.
